import React from "react";
import Alert from "react-alert";
function ButtonUse() {
  function myFunction(x) {
    Alert(x);
  }
  return (
    <div>
      <input
        placeholder="https://linkedin.com"
        type="url"
        id="linkedinUrl"
        classname="inputs"
      ></input>
      <br></br>
      <button type="button" onclick={myFunction(linkedinUrl)}>
        Start
      </button>
    </div>
  );
}

export default ButtonUse;
